import React from "react";
import "./ProjectTabs.css";
import { Nav, Tabs, Tab, Row, Col } from "react-bootstrap";
import { render } from "react-dom";

const ProjectTitles = [
  { title: "RIDSI", key: "ridsi" },
  { title: "Missouri Bicentennial Events", key: "events" },
  { title: "OTHER", key: "other" },
  { title: "OTHER2", key: "other2" },
];

const ProjectItems: React.FC = () => {
  const Items = ProjectTitles.map((project) => {
    render()(
      <Nav.Item>
        <Nav.Link eventKey={project.key}>Tab 1</Nav.Link>
      </Nav.Item>
    );
  });
  return (
    <Tab.Container id="left-tabs-example" defaultActiveKey="first">
      <Row>
        <Col sm={3}>
          <Nav variant="pills" className="flex-column">
            <ProjectItems />
          </Nav>
        </Col>
      </Row>
    </Tab.Container>
  );
};

const ProjectTabs: React.FC = () => {
  return (
    <div className="projects-body">
      <Row>
        <ProjectItems />
      </Row>
    </div>
  );
};
export default ProjectTabs;
